import { TextDatasource, createCredentials } from "buttercup-web";
import ButtercupMirror from "../components/ButtercupMirror.js";

let __currentMirror = null;
let __deferredCryptoWork = null;

export function deferCrypto() {
    __deferredCryptoWork = new Promise(function(resolve) {
        let waitInterval = setInterval(function() {
            const mirror = ButtercupMirror.getCurrentMirror();
            if (mirror !== null) {
                clearInterval(waitInterval);
                __currentMirror = mirror;
                resolve();
            }
        }, 100);
    });
}

export function testLoadArchive() {
    const test = "b~>$a8f6aaa53c487d7dd79111e877dadcf3$6907b15a4d82$7eb02f7fc1e2cdb975a607fb7efc858610e7f7059bcc04d9fdc9a816dee92425$209707";
    const tds = new TextDatasource(test);
    return tds.load(createCredentials.fromPassword("test"));
}

export function waitForInit() {
    if (!__deferredCryptoWork) {
        deferCrypto();
    }
    return Promise
        .all([
            __deferredCryptoWork
        ])
        .then(function() {
            TextDatasource.setDeferredEncodingHandlers(
                __currentMirror.handleDeferredDecode.bind(__currentMirror),
                __currentMirror.handleDeferredEncode.bind(__currentMirror)
            );
        });
}
